              color: 'positive',
              icon: 'check_circle',
              position: 'top-right'
            })
            fetchInstructors()
          })
          .catch(() => {
            $q.notify({
              message: 'gagal mengedit instruktur',
              color: 'negative',
              icon: 'cancel',
              position: 'top-right'
            })
          })
        closeEditDialog()
      }

      function printDataDialog(member){
        var myWindow = window.open("", "printWindow", "width=1200,height=700");
        var content =
          `<!DOCTYPE html>
<html>
<head>
	<title>VIP Member Card</title>
	<style>
