		  flex-direction: column;
		  justify-content: center;
		  align-items: center;
		}

		.vip {
		  background-image: url( data:image/png;base64,);
		  color: #fff;
      background-repeat: no-repeat;
      background-size: cover;
		}

		img {
		  width: 80px;
		  height: 80px;
		  border-radius: 50%;
		  object-fit: cover;
		  margin-bottom: 10px;
		}

		h2 {
		  font-size: 24px;
		  margin-bottom: 5px;
		}

		p {
		  font-size: 18px;
