    onMounted(() => {
      fetchInstructors();
    });
    return {
      columns,
      rows,
      deleteDataDialog,
      newData,
      newDialog,
      showNewDialog,
      editData,
      closeNewDialog,
      saveNewData,
      searchString,
      fetchInstructors,
      showEditDialog,
      editDialog,
      closeEditDialog,
      saveEditData,
      printDataDialog


    };
  },
});
</script>
